(161, 'Multiple Choice Single Answer', '<p>A new project has just completed the initiating process group. The planning process group is getting ready to begin. Which process has just been accomplished, and which process is getting ready to start?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(162, 'Multiple Choice Single Answer', '<p>The team has completed the planning process group and received approval from sponsor and senior management to move to the executing process group. During the executing processes, the team compares their work to&hellip;&hellip;&hellip;.</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(163, 'Multiple Choice Single Answer', '<p>The project manager and her team are working on the creation of the project management plan. As they evaluate what should be in the document, they express various opinions. Which of the following best describes what should be in the project management plan?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(164, 'Multiple Choice Single Answer', '<p>The new system integration project impacts all the departments in the company, directly or indirectly. Which of the following is the best description of tools used for the project&rsquo;s communications?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(165, 'Multiple Choice Single Answer', '<p>The project manager and his team have just started the perform Integrated change control process for a high profile project. They are carefully considering all the outputs to make certain that the process is conducted successfully. Which of the following is not output to this process?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(166, 'Multiple Choice Single Answer', '<p>A provider of wireless enterprise applications has created a system that allows customers to remotely conduct configuration management. Of the following, which is the most comprehensive description of configuration management?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(167, 'Multiple Choice Single Answer', '<p>A large part of a project manager&rsquo;s time is spent communicating. What is the main benefit of this activity to the project?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(168, 'Multiple Choice Single Answer', '<p>The customer has just attended the weekly staff meeting for the infrastructure project and has stated that the market is changing for the product the project will create. In response to the market conditions, the customer has requested a significant change to the project. The project is 85% complete. What should the project manager do in this case?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(169, 'Multiple Choice Single Answer', '<p>Which of the following uses cross-functional work teams?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(170, 'Multiple Choice Single Answer', '<p>The project team has begun development on a very important project in a new evolving technology market. Because the market is so volatile, the product they are creating doesn&rsquo;t necessarily have all the details defined before planning begins. The team chooses to take an approach to plan as much as they can and begin to create work based on that effort while continuing the planning as they learn more about the project. Which of the following best describes the approach?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(171, 'Multiple Choice Single Answer', '<p>Which of the following is an advantage of a functional organization?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(172, 'Multiple Choice Single Answer', '<p>You are a project manager for a highway construction project. You have just finished integrating the various management plans into a complete document. What process will you perform next?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(173, 'Multiple Choice Single Answer', '<p>Aside from the fact that the sponsor changed twice, the e-commerce project has gone well. The project is performing the monitoring and controlling of the project work. What will they focus on most?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(174, 'Multiple Choice Single Answer', '<p>You&rsquo;re a supervisor asks for a copy of the project management plan and when you provide it to him, he says, &ldquo;&rsquo;I didn&rsquo;t ask for all this information! Just give me what I asked for!&rsquo;&rsquo; You don&rsquo;t understand why he is saying this. Which answer below best describes this situation?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(175, 'Multiple Choice Single Answer', '<p>he new system integration project impacts all the departments in the company, directly or indirectly. Which of the following is the best description of tools used for the project&rsquo;s communications?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(176, 'Multiple Choice Single Answer', '<p>The team has completed the planning process group and received approval from the senior management to move to the executing process group. During the executing processes, the team will they compare their work to&hellip;&hellip;&hellip;&hellip;&hellip;.</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(177, 'Multiple Choice Single Answer', '<p>Sign-off has just occurred on the project charter. There are items in the project charter that mandates a specific vendor and describe the maximum amount of physical and computer storage space available to the team. These are examples of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(178, 'Multiple Choice Single Answer', '<p>The project manager and her team are working on the creation of the project plan. As they evaluate what should be in the document, they express various opinions. Which of the following best describes what should be in the project management plan/</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(179, 'Multiple Choice Single Answer', '<p>The customer has just attended the weekly staff meeting for the infrastructure project and has stated that the market is changing for the product will create. In response to the market conditions. The customer has requested a significant change to the project. The project is 85% complete. What should the project manager do in this case?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(180, 'Multiple Choice Single Answer', '<p>The project manager and his team have just started the perform integrated change control process for a high profile project. They are carefully considering all the inputs to make certain that the process is conducted successfully. Which of the is not an input to this process?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(181, 'Multiple Choice Single Answer', '<p>The project manager for the electric engine improvement project has implemented a work authorization system. What is the main benefit of utilizing a work authorization system?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(182, 'Multiple Choice Single Answer', '<p>The healthcare project is in the planning stage and the project manager and his team are making decisions about the project management Information system (PMIS). In disc using the system they feel will work best, which of the following statements is the project manager most likely to make?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(183, 'Multiple Choice Single Answer', '<p>Which of the following is an output of a change control system?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(184, 'Multiple Choice Single Answer', '<p>The green energy generator upgrade project has been completed. As a result of the recent economic stimulus package that was approved, some adjustments to scope were made in order to gain approval from the sponsors. The project manager and her team are in the process of creating the project archives. Of the following, which best describes project archives?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(185, 'Multiple Choice Single Answer', '<p>The team is completing the process of reviewing how the bridge expansion project worked. The team members are analyzing what worked well and what didn&rsquo;t. They are evaluating the planning, Executing, and changes that were approved and rejected. They are documenting how various stakeholders supported the project. What are they doing?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(186, 'Multiple Choice Single Answer', '<p>The project to create a new drill type for an oil exploration initiation has been in progress for twelve months. Of the following, what best describes when it closes?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(187, 'Multiple Choice Single Answer', '<p>The team has just completed the process of evaluating how the project went. The team members analyzed what worked well and what didn&rsquo;t. They evaluate the planning and execution. They documented how the sponsor and senior management supported the project. What process did they perform?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(188, 'Multiple Choice Single Answer', '<p>The team has just completed the process of reviewing how the bridge expansion project worked. The team members analyzed what worked well and what didn&rsquo;t. They documented how various stakeholders supported the project. What process did they perform?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(189, 'Multiple Choice Single Answer', '<p>You are doing some analysis associated with project selection. There is a lot of debate concerning which projects to select. You have the following to choose from: Project A with an Internal Rate of return (IRR) of 18.2%, Project B with an internal rate of return (IRR) of 21%, Project C with an internal rate of return (IRR) of 13%, and project D with an internal rate of return (IRR) of 9%. If you can select only one project, which do you choose?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(190, 'Multiple Choice Single Answer', '<p>There are less than 20 key roles in project management, per PMI, each with unique responsibilities. Of the following, which is the most accurate and comprehensive description of a project management role and its responsibility?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(191, 'Multiple Choice Single Answer', '<p>The project manager and his team are considering performance information during the monitor and control project work process for the project to apply night vision technology to existing products designed for the military. What are they most likely to do with this information?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(192, 'Multiple Choice Single Answer', '<p>A leading global supplier of products for automobiles is showcasing its product and solutions for vehicle safety and performance efficiency at an international automotive event held in Asia in an effort to garner a greater share of the market. The project plan and execute the supplier&rsquo;s participation has just completed the Direct and manage project execution process for the project. What did the project manager and his team create?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(193, 'Multiple Choice Single Answer', '<p>Due to the economic downturn, the project selection committee has been instructed to limit their selection to one project over and above those projects which fulfill legal requirements. Of the project requests not related to fulfill legal requirements: Project A has an IRR of 9.25%, Project B has an IRR of 15%, Project C has an IRR of 8%, and Project D has an IRR of 18%. Which project is the committee most likely to select?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(194, 'Multiple Choice Single Answer', '<p>The enhanced integration project for a web-based payroll/human resources service company and its subsidiary, a benefits enrolment and administration Technology Company, was initialized to effect the seamless transfer of data from one system to the other. The automatic transfer of newly entered data is anticipated to result in cost and time savings for customers and increased data accuracy. As the project moves into the executing process group, which of the following will the team use as the basis for comparison?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(195, 'Multiple Choice Single Answer', '<p>The project manager is in the planning process of a project to consolidate the reporting for the live vaccine unit of the pharmaceutical company. He is very concerned about the impact of the business unit integration project which was just approved. One of its selling points was that it would eliminate a number of existing projects. Of the following, which represents the area of greatest concern to the project manager of the reporting consolidation project?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(196, 'Multiple Choice Single Answer', '<p>Of the following, in accordance with best practices, who should create the cumulative document that contains all the documents used in the project management approach to the project?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(197, 'Multiple Choice Single Answer', '<p>A high-growth lighting company is streamlining its storage system architecture and enjoying more efficient data access using a virtualized storage solution. The solution also provides instant data backup via data snapshot technology eliminating the time-consuming and costly tape back-up system that was in use. The team for the project to develop the architecture has completed their evaluation of the project: documenting support provided by senior management and project sponsors, evaluating planning and execution, and analyzing what worked well and what didn&rsquo;t. Of the following, which best describes the process that includes this work?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(198, 'Multiple Choice Single Answer', '<p>In an effort to develop new technology that will increase oil recovery, a research alliance between a petroleum company and a university has announced preliminary results. Using mathematical models, the alliance has put forth cost efficient recovery solutions for the fields studied. The petroleum company is now pursuing the solutions. You are the project manager fo the cost recovery project for the bliden field in Alaska and are working with the best field manager in the company. At the monthly meeting with the best field manager in the company. At the monthly meeting with the best CEO, you are informed that the field manager will be reassigned to a higher priority project. You inform the CEO that the resource&rsquo;s involvement in your project is critical to the project&rsquo;s success, but the CEO will not reconsider. Of the following, which is the most prudent action you should take?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(199, 'Multiple Choice Single Answer', '<p>A large grocery chain has approved a project to expand its line of natural and organic products from 20 products to 300 products. A new member of senior management requested the project manager to provide her with a copy of the project management plan. Upon receipt, she complained that she didn&rsquo;t want all that information. What do you think she really wanted?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(200, 'Multiple Choice Single Answer', '<p>What is the most accurate benefit below for using a work authorization system?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(201, 'Multiple Choice Single Answer', '<p>The project management team was involved in the planning process for the project the deploy the new accounting system when senior management informed the project manager that the mandatory completion date was changed from September 30<sup>th</sup> to August 15<sup>th</sup>. Which of the following is the best description of this change?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(202, 'Multiple Choice Single Answer', '<p>The project charter for the project to create a web-based policy manual includes details concerning the software that must be used and the times the content can be uploaded to the testing servers. What is another name for these details?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(203, 'Multiple Choice Single Answer', '<p>A touch-screen internet-enabled multimedia mobile phone is being created for a U.S. cell phone provider. Although the pride has not yet been determined, nit should be considerably lower than the cost of the existing convergence phone. The provider is betting heavily on the phone, planning for a marketing campaign 5 times more costly than its typical product launch campaign. The project to implement the marketing campaign is in the hands of a very experienced project manager, who understands the importance of a project&rsquo;s communications. What is the best description of the tool he will use to direct and manage project execution?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(204, 'Multiple Choice Single Answer', '<p>The PMIS (Project management information system) is a combination of hi-tech tools used by project participants. What is the purpose of this system?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(205, 'Multiple Choice Single Answer', '<p>During the monitor and control project work process, what inputs will the project manager and her team consider?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(206, 'Multiple Choice Single Answer', '<p>During the planning stage of the project to deploy a network management solution that will manage system capacity across physical and virtual servers, the project manager and his team make assumptions for scheduling and budgeting. What is the likely source for those assumptions?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(207, 'Multiple Choice Single Answer', '<p>Your DVD Training project is almost complete. You have outsourced the DVD creation to an out-of-state company to complete. As the project closes down, what will be completed last?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(208, 'Multiple Choice Single Answer', '<p>The review of the project to develop an interactive computer reading program for toddlers has been completed by the project team. The review included: an evaluation of planning, execution. Approved changes, and reject changes; an analysis of what worked and what didn&rsquo;t; and documentation of the manner in which the stakeholders supported the project. What was the project team doing?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(209, 'Multiple Choice Single Answer', '<p>You are the chief project manager of the PMO with your company. Your job is to analyze projects when they close and validate the effectiveness of the project effort. The project closing could be the result of when a project is complete or by any other means. When would you expect to close a project?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(210, 'Multiple Choice Single Answer', '<p>A project manager is progressively elaborating and documenting the project work. With help from the project charter and product description, the project manager has defined the scope of the project. The project manager is performing what process?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(211, 'Multiple Choice Single Answer', '<p>The work breakdown structure represents what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(212, 'Multiple Choice Single Answer', '<p>In defining a milestone, which of the following is most correct?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(213, 'Multiple Choice Single Answer', '<p>A project manager has completed the define scope process. The customer and sponsor have shortened the schedule by four weeks and decided to exclude the work breakdown structure. The project manager informs the customer and sponsor that, by excluding the WBS, the project could be subjected to many problems. Which of the following is not considered a problem of bypassing the work breakdown structure?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(214, 'Multiple Choice Single Answer', '<p>The project team has just started breaking down the components of the project into smaller pieces that are easier to maintain and manage. In what process will the work be decomposition to the lowest possible level.</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(215, 'Multiple Choice Single Answer', '<p>&nbsp;The verify scope process has been started at the end of phase 3 of the project. The main deliverables were sent to the customer. Three weeks have passed and the customer acts as if the deliverables were never received. Which of the following is the best action to take?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(216, 'Multiple Choice Single Answer', '<p>A project manager is assigned to a project that is in the construction phase of a video computer board. The project manager is reviewing deliverables and work results to gain formal acceptance. This activity is known as what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(217, 'Multiple Choice Single Answer', '<p>The medical billing system project has entered closure. As the project manager and the team prepare for closure, they are told that verify scope will be very important to the success of the project. Why is this?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(218, 'Multiple Choice Single Answer', '<p>There has been a great delay in waiting to get the project charter approved. It&rsquo;s finally complete and you are assigned as the project manager. Senior management wants you to begin the planning process group as soon as possible. If you are in the process of planning the project, when should you schedule verify scope?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(219, 'Multiple Choice Single Answer', '<p>The project manager is working with the customer to gain formal acceptance on the project deliverables are not meeting project goals and are unusable in their present form. Which process will ensure the new deliverables reflect the characteristics needed by the customer?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(220, 'Multiple Choice Single Answer', '<p>The project team is involved in created the Work Breakdown Structure of the project. Which of the following best describes a work breakdown structure (WBS) that will be created?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(221, 'Multiple Choice Single Answer', '<p>The trade show project team has just begun breaking down the pieces of the project into smaller easier to maintain and manage pieces. This is known as what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(222, 'Multiple Choice Single Answer', '<p>Project A is four months long, has four stakeholders, and has completed planning. Project B is 12 months long, has 10 stakeholders, and is in execution. Project C is 12 months long, has four stakeholders, and is in planning. Which project is most likely to experience scope creep?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(223, 'Multiple Choice Single Answer', '<p>The medical software project has been going on for two years with a large number of changes and issues. The project manager is getting ready for the project to be completed. Which of the following will help close the project?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(224, 'Multiple Choice Single Answer', '<p>If the project manager is concerned about satisfying a customer, which of the following will they pay the most attention to?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(225, 'Multiple Choice Single Answer', '<p>The team is involved in determining what the scope management plan for the project will be. Which of the following will they need to start this?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(226, 'Multiple Choice Single Answer', '<p>The project manager, three business analysts, and a system analyst have created requirements for the intranet shareware application. They are in the process of defining project scope based on the requirements and scope definition. What is the best reason for this?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(227, 'Multiple Choice Single Answer', '<p>The project team is involved in the decomposition of the work of the project. What two things will they create as a result of decomposition on the project?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(228, 'Multiple Choice Single Answer', '<p>The project manager, three business analysts, and a system analyst have created requirements for the intranet share ware application. Which of the following best describes what they will create as part of the requirements?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(229, 'Multiple Choice Single Answer', '<p>Due to the complexity of the project to design and manufacture robotic guard dogs for use at remote government sites, a number of breakdown structures and descriptions, which is correct?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(230, 'Multiple Choice Single Answer', '<p>The cost at a company that manufactures cosmetics has been extremely high and a new project is underway to save costs without negatively impacting quality and customer service. The program manager and his team are in the Define scope process. Of the following, which tools are available for their use?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(231, 'Multiple Choice Single Answer', '<p>You are a project manager on a TV transmission tower project. Due to the rough terrain, the scope of the project had to be modified to compensate for the required foundation changes. You need to verify that these changes have been put in place. What best helps you determine this?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(232, 'Multiple Choice Single Answer', '<p>The project manager is working with the customer to gain formal acceptance of the project deliverables. The customer is saying that three of the deliverables are not meeting project goals and are unusable in their present form. Which process will ensure that the new deliverables reflect the needs of the customer?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(233, 'Multiple Choice Single Answer', '<p>On the digital healthcare infrastructure project, the PMO is performing an audit of the project. As part of this audit, they are monitoring compliance with the project management plan and completed deliverables. Of the following, which best describes what they will do with this information?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(234, 'Multiple Choice Single Answer', '<p>The project team has just begun the verify scope process. Of the following, what are the inputs they will consider</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(235, 'Multiple Choice Single Answer', '<p>The medical billing system project has entered closure. As the project manager and the team prepare for closure, they are told that verify scope will be very important to the success of the project. Of the following, which best describes the importance of verify scope?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(236, 'Multiple Choice Single Answer', '<p>In an effort to obtain value from its supply chain, a national retailer has implemented a three pronged approach: reducing transportation costs by delaying transportation of materials that are not time-critical; creating robust models that simulate the experience rather than deploying assets; and managing behaviour by identifying and eliminating sources of friction. The project to create requests reviewed. What inputs are available to the project manager and her team during this process?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(237, 'Multiple Choice Single Answer', '<p>A large corporation has just approved a project to develop a subatomic particle board demonstration platform for microcontroller products which will enhance the experience of engineers via fully integrated hardware and software. The platforms will include online tutorials for set-up and creating, building, debugging, and downloading project and will include project management functionality. The Purpose of the platform is to decrease development time. The project manager has just started the planning process group. The project manager has just started the planning process group. Of the following, which is the most opportune time to schedule the verify scope process?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(238, 'Multiple Choice Single Answer', '<p>You are the project manager on the development of a RAID 4 computer storage network. The customer has been very concerned about the correctness and acceptance of the work results as they have had corrupt data in the past and the goal is to have this serve as a backup system. You are not sure what the customer is saying about the &ldquo;correctness and acceptance&rdquo; so you review your PMBOK &reg; Guide. What areas below will likely be involved in attaining what the government is concerned about?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(239, 'Multiple Choice Single Answer', '<p>To gain formal acceptance of the deliverables for the project to upgrade the company&rsquo;s air fleet, the project manager works with the customer. The customer claims that three of the deliverables do not meet project goals and are unusable in their present form. Of the following, which process ensures that deliverables reflect the needs of the customer?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(240, 'Multiple Choice Single Answer', '<p>As a project manager, you are managing a project that has 95 pages of requirements. The project is for high profile customer that spends more than $2,500,000 a year with your company. You have completed this project on schedule and on budget. The customer is not pleased with the product that was built as they say it won&rsquo;t work as they need it to. What should the project manager do?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(241, 'Multiple Choice Single Answer', '<p>Which of the following best describes lag?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(242, 'Multiple Choice Single Answer', '<p>The project team is working together on detailed planning. They have had some issues coming to the same opinion on the planning. They are creating a project schedule network diagram. What will this show the team?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(243, 'Multiple Choice Single Answer', '<p>The client has requested a four-week delay on the project while the company retools its machine lab. This delay was not planned, but the equipment had to be replaced. The company has limited resources. What is the best way to make up the four-week slip?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(244, 'Multiple Choice Single Answer', '<p>The project manager is creating an estimate for building a house. It is a house similar to what he builds quite often. He is using the rule of thumb of $85 per square foot to calculate the estimate. What type of estimate is this?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(245, 'Multiple Choice Single Answer', '<p>The IT initiative project is on schedule and under budget. The customer is pleased but wants a scope change. As a result, a new team is brought in to help the existing team implement this scope change. Before the team arrives, senior management wants to see where the project stands. Which of the following do you show them?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(246, 'Multiple Choice Single Answer', '<p>The construction team is behind schedule on its project. The customer is considering giving the project to another company if they cannot get the project back on track. The team is considering putting more resources on the critical path to accelerate the schedule. This is an example of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(247, 'Multiple Choice Single Answer', '<p>The project manager is creating an estimate for building a house. It is a house similar to what he builds quite often. He is using the rule of thumb of $85 per square foot to calculate the estimate. What type of estimate is this?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(248, 'Multiple Choice Single Answer', '<p>JK Michaels is building a customer&rsquo;s dream house. However, the city inspector for building permits has been in training for the last two weeks, and he has no backup. His absence causes a delay in the completion of the house. This is an example of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(249, 'Multiple Choice Single Answer', '<p>In the original network diagram question, if Activity G decreases from five days to one, what is the critical path, and what is the length?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(250, 'Multiple Choice Single Answer', '<p>JK Michaels is building a customer&rsquo;s dream house; however, the rain has delayed the finish by two weeks. The project manager evaluates the schedule and determines that the electrical and plumbing could occur at the same time instead of right after each other, as laid out in the schedule. This is an example of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(251, 'Multiple Choice Single Answer', '<p>JK Michaels is building a customer&rsquo;s dream house. However, the rain has delayed the finish by two weeks. The schedule shows that the next activity is to install the roof followed by the shingles. This is an example of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(252, 'Multiple Choice Single Answer', '<p>JK Michaels is building a shopping center. However, the rain has delayed the finish by two weeks. The project manager is evaluating various ways to compress the schedule. The project manager suspects that the windows and climate control could occur at the same time instead of right after each other as laid out in the schedule. It is an example of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(253, 'Multiple Choice Single Answer', '<p>Float on a Network diagram is also known as:</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(254, 'Multiple Choice Single Answer', '<p>Which of the following utilizes a dummy?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(255, 'Multiple Choice Single Answer', '<p>JK Michael\'s websites are building a huge eCommerce system. However, the designer getting sick has delayed the finish by two weeks. The project manager evaluates the schedule and determines that the graphics and backend work could occur at the same time instead of right after each other, as laid out in the schedule. This is an example of what?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(256, 'Multiple Choice Single Answer', '<p>Using the original Network diagram question, what is the Slack of Task D?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(257, 'Multiple Choice Single Answer', '<p>Using the original Network diagram question, if Task D increases from five to eight days, what is the Critical Path, and what is the length?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(258, 'Multiple Choice Single Answer', '<p>The road construction project is twelve weeks behind schedule with ten team members working on it. Five of these team members are working on the critical Path related items. What is the Slack of the Critical Path?</p>', '', NULL, NULL, 4, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
