(310, 'Multiple Choice Single Answer', '<p>&nbsp;The project manager and functional manager are having a disagreement on resource allocation for a new broadband project. The functional manager wants the resource for an operational issue that needs attention, and the project manager wants the resource to work on the project so it stays on schedule as planned. Which of the following roles can help resolve this problem?</p>', '', NULL, NULL, 4, 1, 59, 25, 21, 13, 1, 'AIGE Admin', NULL, NULL, 0),
