(315, 'Multiple Choice Single Answer', '<p>The PMO audits four projects each month, One of the four selected for February is a project to expand the existing content management system to include the regulatory manuals that impact the company. The audit procedures mandate that the PMO monitors compliance with the project management plan. Which best describes the actions the PMO will take in regard to the monitoring information.</p>', '', NULL, NULL, 4, 1, 59, 29, 8, 22, 1, 'AIGE Admin', NULL, NULL, 0),
