(320, 'Multiple Choice Single Answer', '<p>You are doing some analysis associated with project selection. There is a lot of debate concerning which projects to select. You have the following to choose from: Project A with an IRR of 10.5%, project B with an IRR of 17%, project C with an IRR of 14%, and project D with an IRR of 12%. If you can select only one project, which do you choose?</p>', '', NULL, NULL, 4, 1, 59, 31, 18, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(321, 'Multiple Choice Single Answer', '<p>You are the project manager on a Restaurant POS System project for Hamburger prince Restaurants. You are fortunate in having the top technical architect in the company on your project. In your monthly meeting with the CEO, you are informed that the architect will be reassigned to a higher priority enterprise reporting system project. You inform the CEO that the resource&rsquo;s involvement on your project is critical to the project&rsquo;s success, but the CEO will not reconsider. What is the best action to take next?</p>', '', NULL, NULL, 4, 1, 59, 33, 16, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(322, 'Multiple Choice Single Answer', '<p>The client has requested a three-week delay on the project while they calibrate their test equipment. This delay wasn&rsquo;t planned, but the equipment must be calibrated. The company is limited to available resources. This delay will be best shown using what?</p>', '', NULL, NULL, 4, 1, 59, 14, 36, 9, 1, 'AIGE Admin', NULL, NULL, 0),
(323, 'Multiple Choice Single Answer', '<p>The company is implementing an enterprise reporting system across the entire company. This system will integrate a number of business units. As a result, it will be very resource-consuming and could cause the reprioritization of other projects that it will replace. Which of the following should concerns you most?</p>', '', NULL, NULL, 4, 1, 59, 9, 39, 11, 1, 'AIGE Admin', NULL, NULL, 0),
(324, 'Multiple Choice Single Answer', '<p>The customer has just attended the weekly staff meeting for the infrastructure project and has stated that the market is changing for the product being created. As a result of this change, the customer has requested a significant change of the project. The project is 85% complete. What does the project manager do?</p>', '', NULL, NULL, 4, 1, 59, 48, 1, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(325, 'Multiple Choice Single Answer', '<p>The project is going well until a stakeholder requests a significant change based on a modification in the stake holder&rsquo;s business process. The change could totally alter the work of the project. The change request and its impact analysis are going before the change control board for review and potential approval. What is the purpose of the change control board?</p>', '', NULL, NULL, 4, 1, 59, 13, 37, 9, 1, 'AIGE Admin', NULL, NULL, 0),
(326, 'Multiple Choice Single Answer', '<p>Which of the following is the best description of configuration management?</p>', '', NULL, NULL, 4, 1, 59, 24, 25, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(327, 'Multiple Choice Single Answer', '<p>The internet project is about 65% complete and has had its challenges. As of the last status report, it appears to be on track regarding cost, schedule, and scope. Senior management tells you that the sponsor has some serious concerns about the project. You don&rsquo;t understand why, based on the last status report. What is the best thing to do first?</p>', '', NULL, NULL, 4, 1, 59, 32, 16, 11, 1, 'AIGE Admin', NULL, NULL, 0),
(328, 'Multiple Choice Single Answer', '<p>You are a project manager for a highway construction project. You have just finished putting together all the various plans into an integrated complete document. What process will you perform next?</p>', '', NULL, NULL, 4, 1, 59, 12, 38, 9, 1, 'AIGE Admin', NULL, NULL, 0),
(329, 'Multiple Choice Single Answer', '<p>The e-commerce project has gone well, other than the fact that the sponsor changed two different times. The project is approaching closure. Which of the following is not expected to come from the close project or phase process?</p>', '', NULL, NULL, 4, 1, 59, 12, 38, 9, 1, 'AIGE Admin', NULL, NULL, 0),
(330, 'Multiple Choice Single Answer', '<p>The team has just completed the work on the project. It has been a long project with a churn rate of 18% on project personnel. Which of the following is best step to complete next?</p>', '', NULL, NULL, 4, 1, 59, 14, 35, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(331, 'Multiple Choice Single Answer', '<p>The team has just completed the process of evaluating how the project went. The team members analyzed what worked well and what didn&rsquo;t. They documented how the sponsor and senior management supported the project. What have they just completed?</p>', '', NULL, NULL, 4, 1, 59, 5, 42, 12, 1, 'AIGE Admin', NULL, NULL, 0),
(332, 'Multiple Choice Single Answer', '<p>The project is in the phase of doing procurement audits. It is important to identify successes and failures of the procurement process. This identification is important for formal acceptance and closure. What process is the project in?</p>', '', NULL, NULL, 4, 1, 59, 23, 28, 8, 1, 'AIGE Admin', NULL, NULL, 0),
(333, 'Multiple Choice Single Answer', '<p>The project manager has worked diligently to complete the project scope on time and budget. The team has completed the work of the project and is getting signoff from the customer. When they&rsquo;ve achieved this, what will they have accomplished?</p>', '', NULL, NULL, 4, 1, 59, 8, 41, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(334, 'Multiple Choice Single Answer', '<p>Which of the following is an output of initiating?</p>', '', NULL, NULL, 4, 1, 59, 17, 30, 12, 1, 'AIGE Admin', NULL, NULL, 0),
(335, 'Multiple Choice Single Answer', '<p>The software development project is going through planning. In evaluating the triple constraint, which of the following has the highest priority?</p>', '', NULL, NULL, 4, 1, 59, 35, 13, 11, 1, 'AIGE Admin', NULL, NULL, 0),
(336, 'Multiple Choice Single Answer', '<p>The project will be starting the executing progress group next week. The project sponsor and the project manager have a meeting scheduled with team and the business units that are impacted by the project. They explain what is expected to happen on the project and how each of the people can help contribute to the success of the project. What is this event called?</p>', '', NULL, NULL, 4, 1, 59, 21, 28, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(337, 'Multiple Choice Single Answer', '<p>Joe Johnson has signed the charter for the project after evaluating the need for the project. He did this because he will pay for the project, and own what is created when the work is complete. What is his role on this project?</p>', '', NULL, NULL, 4, 1, 59, 44, 5, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(338, 'Multiple Choice Single Answer', '<p>The team has been having issues with work being done as intended because of scope misinterpretation. They are considering using a work Authorization system. What is the main purpose of utilizing a work Authorization system?</p>', '', NULL, NULL, 4, 1, 59, 23, 25, 11, 1, 'AIGE Admin', NULL, NULL, 0),
(339, 'Multiple Choice Single Answer', '<p>You and a team member are having a disagreement about some terminology with project management documentation. He asks you where the project management plan is, and when provide it to him, he says, &lsquo;&rsquo;I don&rsquo;t need a thesis. &ldquo;You don&rsquo;t understand why he is saying this. Which answer below best descries the confusion?</p>', '', NULL, NULL, 4, 1, 59, 30, 19, 10, 1, 'AIGE Admin', NULL, NULL, 0),
(340, 'Multiple Choice Single Answer', '<p>The company is implementing an enterprise time system across the entire company. This will integrate a number of business units. As a result, it will be very resource-consuming, change a lot of the business processes and could cause reprioritization of other projects that it will replace or modify. Which of the following would concern you most?</p>', '', NULL, NULL, 4, 1, 59, 27, 22, 10, 1, 'AIGE Admin', NULL, NULL, 0),
