(344, 'Multiple Choice Single Answer', '<p>You are assigned to a new call centre project and notice that there are five business units listed as sponsors on the charter. The call centre has been discussed at your organisation for some time because it has been desperately needed, but this is everyone&rsquo;s first exposure to implementing one. Which of the following would concern you the most about this project?</p>', '', NULL, NULL, 4, 1, 59, 2, 49, 8, 1, 'AIGE Admin', NULL, NULL, 0),
