(356, 'Multiple Choice Single Answer', '<p>A nuclear system recovery project is in the planning stage and the project manager and his team are discussing the various communication needs of the project stakeholders. As they are considering the stakeholders needs, they decide to use a PMIS (project management information system). Which of the following describes the primary functionality of PMIS?</p>', '', NULL, NULL, 4, 1, 59, 38, 15, 6, 1, 'AIGE Admin', NULL, NULL, 0),
