(358, 'Multiple Choice Single Answer', '<p>A man&rsquo;s wages were decreased by 50%. Again, the reduced wages were increased by 50%. He has a loss of __________</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(359, 'Multiple Choice Single Answer', '<p>The length and breadth of a square are increased by 30% and 20%, respectively. The area of the rectangle so formed exceeds the area of the square by___________</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(360, 'Multiple Choice Single Answer', '<p>The sum of three numbers is 98. If the ratio between first and second be 2:3 and that between second and third be 5:8, then the second number is_________</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(361, 'Multiple Choice Single Answer', '<p>A number <em>x </em>equals 80% of the average of 5, 7, 14 and a number <em>y</em>. If the average of <em>x </em>and <em>y </em>is 26, the value of <em>y </em>is_______</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(362, 'Multiple Choice Single Answer', '<p>When <em>x </em>is added to each term of 7:13 the ratio becomes 2:3. The value of <em>x </em>is________________</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(363, 'Multiple Choice Single Answer', '<p>The incomes of <em>A </em>and <em>B </em>are in the ratio 3:2 and their expenditures in the ratio 5:3. If each saves N1000, <em>A</em>&rsquo;s income is_____________</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(364, 'Multiple Choice Single Answer', '<p><em>A </em>and <em>B </em>finish a job in 12 days while <em>A</em>, <em>B </em>and <em>C </em>can finish it in 8 days. <em>C </em>alone will finish the job in____________</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(365, 'Multiple Choice Single Answer', '<p>Ade was twice as old as Ajayi 10 years back. How old is Ajayi today if Ade will be 40 years old 10 years later?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(366, 'Multiple Choice Single Answer', '<p>&ldquo;I am eight times as old as you were when I was as old as you are&rdquo;, said a man to his son. Find out their present ages if the sum of their ages is 75 years</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(367, 'Multiple Choice Single Answer', '<p>A sum of money invested at simple interest triples itself in 8 years. How many times will it become in 20 years&rsquo; time?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 0, 0, 0, 0, 1, 'AIGE Admin', NULL, NULL, 0),
(368, 'Multiple Choice Single Answer', '<p>If the rate of simple interest is 12% per annum, the amount that would fetch interest of N6,000 per annum is:</p>', '', NULL, NULL, 5, 1, 8, 2, 2, 4, 1, 'AIGE Admin', NULL, NULL, 0),
