(370, 'Multiple Choice Single Answer', '<p>March 5, 1999 was on Friday. What day of the week was on March 5, 2000?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 5, 1, 2, 1, 'AIGE Admin', NULL, NULL, 0),
(371, 'Multiple Choice Single Answer', '<p>In a class of 20 students in an examination in Mathematics 2 students scored 100 marks each, 3 got zero each and the average of the rest was 40. What is the average of the whole class?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 6, 0, 2, 1, 'AIGE Admin', NULL, NULL, 0),
(372, 'Multiple Choice Single Answer', '<p>The average monthly salary of a staff of 9 persons is N2,450. One member of the staff whose monthly salary is N2,650 is transferred. Find the average salary of the remaining 8 persons of the staff.</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 4, 2, 2, 1, 'AIGE Admin', NULL, NULL, 0),
(373, 'Multiple Choice Single Answer', '<p>3 years ago, the average age of a family of 5 members was 17 years. With the birth of a new baby, the average remains the same even today. Find the age of the baby.</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 2, 4, 2, 1, 'AIGE Admin', NULL, NULL, 0),
(374, 'Multiple Choice Single Answer', '<p>Three numbers <em>A</em>, <em>B </em>and <em>C </em>are in the ratio of 12:15:25. If sum of these numbers is 312, find the ratio between the difference of <em>B </em>and <em>A </em>and the difference of <em>C </em>and <em>B</em>.</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 0, 5, 3, 1, 'AIGE Admin', NULL, NULL, 0),
(375, 'Multiple Choice Single Answer', '<p>A shopkeeper sells 20 pencils for the same money as he paid for 25. What is his gain percent?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 1, 3, 4, 1, 'AIGE Admin', NULL, NULL, 0),
(376, 'Multiple Choice Single Answer', '<p>If 3<em>A </em>= 4<em>B </em>= 5<em>C</em>, then <em>A: B</em>:<em>C is</em>_________</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 2, 3, 3, 1, 'AIGE Admin', NULL, NULL, 0),
(377, 'Multiple Choice Single Answer', '<p>A shopkeeper sells an article at a gain of 10%. Had he sold it at a loss of 20%, its selling price would have been N180 less. What is the cost price of the article?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 1, 1, 6, 1, 'AIGE Admin', NULL, NULL, 0),
(378, 'Multiple Choice Single Answer', '<p>Rita sells a calculator to Gabriel at a gain of 17% and Gabriel sells it to Stanley at a loss of 25%. If Stanley pays N1,842.75 for it, what did Rita pay for it?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 1, 4, 3, 1, 'AIGE Admin', NULL, NULL, 0),
(379, 'Multiple Choice Single Answer', '<p>10 men can complete a piece of work in 15 days and 15 women can complete the same work in 12 days. If all the 10 men and 15 women work together, in how many days will the work get completed?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 1, 3, 4, 1, 'AIGE Admin', NULL, NULL, 0),
(380, 'Multiple Choice Single Answer', '<p>5 men can complete a work in 2 days, 4 women can complete the same work in 3 days and 5 children can do it in 3 days, 1 man, 1 woman and 1 child, working together can compete the work in___________</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 0, 5, 3, 1, 'AIGE Admin', NULL, NULL, 0),
(381, 'Multiple Choice Single Answer', '<p>Ten years ago, Ayo was thrice as old as Dele was but 10 years later, he will be only twice as old. Find Ayo&rsquo;s present age.</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 2, 2, 4, 1, 'AIGE Admin', NULL, NULL, 0),
