(384, 'Multiple Choice Single Answer', '<p>The probability of raining on day 1 is 0.2 and on day 2 is 0.3 What is the probability of raining on both days?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 1, 5, 2, 1, 'AIGE Admin', NULL, NULL, 0),
(385, 'Multiple Choice Single Answer', '<p>A bag contains 2 red, 3 green and 2 blue balls. 2 balls are to be drawn randomly. What is the probability that the balls drawn contain no blue ball?</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, 5, 1, 8, 1, 6, 1, 1, 'AIGE Admin', NULL, NULL, 0),
