(682, 'Multiple Choice Single Answer', '<p>Fish stocks in the North Sea are nearly exhausted</p>', '', NULL, NULL, 5, 1, 25, 3, 20, 2, 1, 'Adeshina Ojo', '<p>In an effort to preserve fishing stocks, the European Union uses a quota system to regulate the number of fish that can be taken out of the North Sea. This involves defining the tonnage of the various types of North Sea fish that each EU member country can take. As soon as the catch is landed &ndash; but not before &ndash; fisherman can be fined for landing more fish at their port than their quota permits. Each year fishermen dump thousands of tons of fish back into the sea either because they have reached their quota and don&rsquo;t want to be fined or because the fish is too small to be caught legally. Some environmental groups feel that exiting approaches are not working since these fish are already dead and throwing them back serves no real purpose. They believe that other steps need to be taken to conserve North Sea fishing stocks and avoid depletion.</p>', NULL, 0),
(683, 'Multiple Choice Single Answer', '<p>Some environmental groups think new fish conversation methods are required.</p>', '', NULL, NULL, 5, 1, 25, 15, 7, 3, 1, 'Adeshina Ojo', '<p>In an effort to preserve fishing stocks, the European Union uses a quota system to regulate the number of fish that can be taken out of the North Sea. This involves defining the tonnage of the various types of North Sea fish that each EU member country can take. As soon as the catch is landed &ndash; but not before &ndash; fisherman can be fined for landing more fish at their port than their quota permits. Each year fishermen dump thousands of tons of fish back into the sea either because they have reached their quota and don&rsquo;t want to be fined or because the fish is too small to be caught legally. Some environmental groups feel that exiting approaches are not working since these fish are already dead and throwing them back serves no real purpose. They believe that other steps need to be taken to conserve North Sea fishing stocks and avoid depletion.</p>', NULL, 0),
(684, 'Multiple Choice Single Answer', '<p>Fishermen can be fined for catching too many fish.</p>', '', NULL, NULL, 5, 1, 25, 2, 19, 4, 1, 'Adeshina Ojo', '<p>In an effort to preserve fishing stocks, the European Union uses a quota system to regulate the number of fish that can be taken out of the North Sea. This involves defining the tonnage of the various types of North Sea fish that each EU member country can take. As soon as the catch is landed &ndash; but not before &ndash; fisherman can be fined for landing more fish at their port than their quota permits. Each year fishermen dump thousands of tons of fish back into the sea either because they have reached their quota and don&rsquo;t want to be fined or because the fish is too small to be caught legally. Some environmental groups feel that exiting approaches are not working since these fish are already dead and throwing them back serves no real purpose. They believe that other steps need to be taken to conserve North Sea fishing stocks and avoid depletion.</p>', NULL, 0),
(685, 'Multiple Choice Single Answer', '<p>The phoenix mars lander has provided proof that life once existed on mars.</p>', '', NULL, NULL, 5, 1, 25, 5, 18, 2, 1, 'Adeshina Ojo', '<p>Nobody knows what lie forms may exist outside our own planet. The search for extra- terrestrial life on the universe took a step nearer to fruition with the discovery In June of what are believed to be traces of water on the surface of mars. Life on our planet requires water and its presence on mars may point towards the existence of past life on the planet. The phoenix mars lander robot landed on the plains of mars on May 25, 2008, searching for signs that the Martian environment might once have been habitable to life. When it dug a ditch in the planet&rsquo;s surface, photos revealed small patches of bright material. Four days later those patches had disappeared, causing scientists to speculate that they were water ice that had previously been buried and which vaporized when exposed to the air. Scientists insisted that if the patches had been salt, they wouldn&rsquo;t have disappeared and if they had been solid carbon dioxide, then they wouldn&rsquo;t have vaporized.</p>', NULL, 0),
(686, 'Multiple Choice Single Answer', '<p>Life forms on mars require water in order to survive.</p>', '', NULL, NULL, 5, 1, 25, 3, 19, 3, 1, 'Adeshina Ojo', '<p>Nobody knows what lie forms may exist outside our own planet. The search for extra- terrestrial life on the universe took a step nearer to fruition with the discovery In June of what are believed to be traces of water on the surface of mars. Life on our planet requires water and its presence on mars may point towards the existence of past life on the planet. The phoenix mars lander robot landed on the plains of mars on May 25, 2008, searching for signs that the Martian environment might once have been habitable to life. When it dug a ditch in the planet&rsquo;s surface, photos revealed small patches of bright material. Four days later those patches had disappeared, causing scientists to speculate that they were water ice that had previously been buried and which vaporized when exposed to the air. Scientists insisted that if the patches had been salt, they wouldn&rsquo;t have disappeared and if they had been solid carbon dioxide, then they wouldn&rsquo;t have vaporized.</p>', NULL, 0),
(687, 'Multiple Choice Single Answer', '<p>How much V.A.T will Annex &amp; Co pay for V.A.T for its services if it&rsquo;s registered with VISCO Tax company and it made a profit of 10% for the month of June.</p>', '', NULL, NULL, 5, 1, 25, 5, 14, 6, 1, 'Adeshina Ojo', '<p>Every business organization operating in Nigeria must pay V.A.T (Value Added Tax) of 17.5% on the profit they make for the product they sell or service they render. However, if your organization is registered with Visco Tax company you will be partly exempted from paying V.A.T on your goods or services.</p>\r\n<p>Every business organization registered with Visco pays a tax of 15%</p>\r\n<p>Using the table below that shows income for June 2013</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"150\">\r\n<p>Company Name</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>Durables ()</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>Perishables ()</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>Services ()</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"150\">\r\n<p>Annex &amp; Co</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>150,000</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>175,000</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>50,000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"150\">\r\n<p>Bisco solutions</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>125,000</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>180,000</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>25,000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"150\">\r\n<p>Casper Nig. Ltd.</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>85,000</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>200,000</p>\r\n</td>\r\n<td width=\"150\">\r\n<p>40,000</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', NULL, 0),
